import React from 'react';
import styled from 'styled-components';
const GridWrapper = styled.div`
  display: grid;
  grid-gap: 10px;
  margin-top: 1em;
  margin-left: 6em;
  margin-right: 6em;
  grid-template-columns: repeat(12, 1fr);
  grid-auto-rows: minmax(25px, auto);
`; 
export const LessFreqUsed = () => (
    <div>
        <div>
            <p></p>
            <h2>Less Frequently Used Beneficiaries</h2>
            <p>List of Less Frequently Used Beneficiaries to be listed here soon !!!</p>
        </div>    
        <GridWrapper>
            <p>Beneficiary Name</p>
            <p>Beneficiary Bank Name</p>
            <p>Beneficiary Account No</p>
            <p>Beneficiary Reference</p>
        </GridWrapper>
    </div>  
)
